        return (
            <div className="Films">
                <div className="toggleBox">
                    <span className="filmsToggle">
                    </span>
                    <span className="channelsToggle">
                    </span>
                </div>
                <div className="newFilms">
                    <p>Новинки</p>
                    <div className="filmsContainer">

                    </div>
                </div>
                <div className="genre">
                    <p>Жанры</p>
                    <div className="genreContainer">

                    </div>
                </div>
            </div>
        )
    }
}

export default Films;
